import React from 'react';
import { Container, Box, Typography, Divider, List, ListItem, ListItemText } from '@mui/material';

const Experience = () => {
  return (
    <Container maxWidth="lg">
      <Box
        style={{
          minHeight: '100vh',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          textAlign: 'left',
          padding: '0 25%'
        }}
      >
        <Typography variant="h4" style={{ marginBottom: '20px' }}>
          Professional Experience
        </Typography>

        {/* Unstructured */}
        <Typography variant="h6">Unstructured, San Francisco, CA</Typography>
        <Typography variant="subtitle1">Developer Advocate Engineer/Sales Engineer (Jul 2023 - Dec 2023)</Typography>
        <List>
          <ListItem>Developed tailored Retrieval Augmented Generation (RAG) systems for clients leveraging GPT4-Turbo or OSS.</ListItem>
          <ListItem>Fine-tuned open-source embedding models and LLMs, including LLama 2, for on-premise systems.</ListItem>
          <ListItem>Implemented LLM solutions on AWS Bedrock and Sagemaker for customers.</ListItem>
          <ListItem>Authored external technical documents, blogs and social media posts for customers to maximize product usage.</ListItem>
          <ListItem>Led teamâ€™s community outreach program and scaled API adoption from 0 to 3500 users.</ListItem>
          <ListItem>Built and maintained comprehensive technical documentation for implementing OSS and hosted solutions.</ListItem>
        </List>
        <Divider style={{ margin: '20px 0' }} />

        {/* Gemini / Nifty Gateway */}
        <Typography variant="h6">Gemini / Nifty Gateway, San Francisco, CA</Typography>
        <Typography variant="subtitle1">Data Scientist (Jan 2022 - Jul 2023)</Typography>
        <List>
          <ListItem>Developed data dashboards leveraging Looker to track product performance and user engagement.</ListItem>
          <ListItem>Served as a key liaison between clients and engineering and product management teams.</ListItem>
          <ListItem>Spearheaded operations for a team of ten, generating over $4M in revenue in the past year.</ListItem>
          <ListItem>Contributed significantly to a team effort that expanded the user base of a self-service tool from zero to 1,500 users.</ListItem>
          <ListItem>Managed company go-to-market strategy for global expansion, increasing product revenue by 30%.</ListItem>
          <ListItem>Wrote technical and non-technical documentation for clients.</ListItem>
          <ListItem>Generated external financial reports leveraging Snowflake and Pandas.</ListItem>
        </List>
        <Divider style={{ margin: '20px 0' }} />

        {/* Other experiences can be added in a similar format */}

      </Box>
    </Container>
  );
};

export default Experience;
